    'When you access your back office and decide to stay logged in, your cookies lifetime defines your browser session. Set here the number of hours during which you want them valid before logging in again.' => 'Kui sisenette tagakontorisse ja otsustate jääda sisselogituks, määrab teie küpsiste elugiga brauseri sessiooni. Sättige siin tundide arv, mille jooksul soovite sisselogituks jääda.',
    'Choose a stability level for the modules downloaded from the Addons Marketplace. All zips pushed on Addons are in stable state unless stated otherwise.' => 'Valige stabiilsustase Lisandite Poest allalaetud moodulitele. Kõik Lisandi zipid on stabiilsed, kui just pole märgitud teisiti.',
