    'Define the upload limit for a downloadable product (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Määratlege üleslaadimise piirangu allalaaditava toode jaoks (megabaitides). Antud väärtus peab olema vähem või võrdne maksimaalsele faili üleslaadimise määrale sätestatud Teie serveri poolt (hetkel %size% MB).',
