    'If you do not allow partial use, the voucher value will be lowered to the total order amount. If you allow partial use, however, a new voucher will be created with the remainder.' => 'Kui te ei luba osalist kasutamist, siis kupongi väärtus vähendatakse ostukorvi väärtuseni. Kui aga lubate, siis luuakse alles jäänud summa kohta uus kupong.',
    'Cart rules are applied by priority. A cart rule with a priority of "1" will be processed before a cart rule with a priority of "2".' => 'Ostukorvi reegleid rakendatakse tähtsuse järjekorras. Ostukorvi reegel tähtsusega 1 rakendatakse enne, kui ostukorvi reegel tähtsusega 2',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Modules & Services > Installed modules.[/1] Then, configure your menu module.' => 'Kui soovid, et kategooriat näidatakse sinu poes, siis mine lehele [1]Moodulid > Moodulid ja teenused > Paigaldatud moodulid.[/1] ning seadista oma menüümoodul.',
    'Recommended dimensions (for the default theme): %1spx x %2spx' => 'Soovituslikud suurused (vaikimisi teemal): %1spx x %2spx',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Modules Manager.[/1] Then, configure your menu module.' => 'Kui soovid, et kategooriat näidatakse sinu poes, siis mine lehele [1]Moodulid > Moodulid ja teenused > Paigaldatud moodulid.[/1] ning seadista oma menüümoodul.',
    'Your internal name for this attribute.' => 'Teie sisemine nimi antud parameetrile.',
    'The public name for this attribute, displayed to the customers.' => 'Avalik nimi antud parameetrile, mida näidatakse klientidele.',
    'The way the attribute\'s values will be presented to the customers in the product\'s page.' => 'Viis, kuidas parameetri väärtused on esitatud klientidele tootelehel.',
    'Choose the attribute group for this value.' => 'Valige atribuudi grupp antud väärtusele.',
    'Choose a color with the color picker, or enter an HTML color (e.g. "lightblue", "#CC6600").' => 'Valige värv värvikaardilt või sisestage HTML värvikoodi (nt. "lightblue" või "CC6600").',
    'Upload an image file containing the color texture from your computer.' => 'Laadige üles pildifail, mis sisaldab värvi tekstuuri.',
    'This will override the HTML color!' => 'See kirjutab üle HTML värvi!',
    'Save then add another value' => 'Salvesta ja siis lisa uus',
    'To add "tags," click in the field, write something, and then press "Enter."' => 'Et lisada "silte" klikige väljal ja kirjutage midagi, seejärel vajutage "Enter"',
    'Allow customers to upload files using the contact page.' => 'Võimaldab klientidel lisada faile kontaktide lehel',
    'Please fill out the message fields that appear by default when you answer a thread on the customer service page.' => 'Palun täitke teate, mis kuvatakse vaikimisi, kui te vastate teemale klienditeeninduse lehelt.',
    'URL for your IMAP server (ie.: mail.server.com).' => 'Teie IMAP serveri URL (nt: mail.server.com).',
    'Port to use to connect to your IMAP server.' => 'Port, mida kasutada Teie IMAP serveriga ühenduse loomisel.',
    'User to use to connect to your IMAP server.' => 'Kasutaja, mida kasutada Teie IMAP serveriga ühenduse loomisel.',
    'Password to use to connect your IMAP server.' => 'Parool, mida kasutada Teie IMAP serveriga ühenduse loomisel.',
    'Delete messages after synchronization. If you do not enable this option, the synchronization will take more time.' => 'Kustutada sõnumid peale sünkroniseerimist. Kui Teie ei luba antud valikut, sünkroniseerimine võtab rohkem aega.',
    'Create new threads for unrecognized emails.' => 'Loo uued teemad äratundmata e-mailidele.',
    'Use POP3 instead of IMAP.' => 'Kasutage IMAP-i asemel POP3.',
    'Do not use RSH or SSH to establish a preauthenticated IMAP sessions.' => 'Ärge kasutage RSH või SSH-d, et luua eeldefineeritud IMAP ühendust',
    'Use the Secure Socket Layer (TLS/SSL) to encrypt the session.' => 'Kasuta TLS/SSL sessiooni krüpteerimiseks.',
    'Validate certificates from the TLS/SSL server.' => 'Valideeri sertifikaadid TLS/SSL serverilt.',
    'Do not validate certificates from the TLS/SSL server. This is only needed if a server uses self-signed certificates.' => 'Ärge valideerige sertifikaadid TLS/SSL serverilt. See on vajalik juhul, kui server kasutab endaallakirjastatud sertifikaate.',
    'Force use of start-TLS to encrypt the session, and reject connection to servers that do not support it.' => 'Sundige kasutama start-TLS krüpteeritud sesiooni ja lükake tagasi kõik ebaturvalised ühendused',
    'Do not use start-TLS to encrypt the session, even with servers that support it.' => 'Ärge kasutage start-TLS krüpteeritud sesiooni, isegi kui server seda toetab.',
    'Add new feature value' => 'Lisa uus omaduse väärtus',
    'Save and add another value' => 'Salvesta ja lisa uus väärtus',
    'Back to the list' => 'Tagasi nimekirja juurde',
    'Add new feature values' => 'Lisa uus omaduse väärtus',
    'To add "tags," click inside the field, write something, and then press "Enter."' => 'Et lisada "silte" klikige väljal ja kirjutage midagi, seejärel vajutage "Enter"',
    'Company name for this brand' => 'Brändi ettevõtte nimi',
    'Company name for this supplier' => 'Company name for this supplier',
    'To add "tags" click in the field, write something and then press "Enter".' => 'To add "tags" click in the field, write something and then press "Enter".',
    'Phone number for this supplier' => 'Tarnija telefon',
    'Mobile phone number for this supplier.' => 'Mobile phone number for this supplier.',
    'Create a new product: CTRL+P' => 'Uue toote loomine: CTRL+P',
    'To have a different title from the category name, enter it here.' => 'Kui soovite, et tiitel erineks kategooria nimest, sisestage see siia.',
    'To have a different description than your category summary in search results page, write it here.' => 'Kui soovite, et kirjeldus erineks kategooria kokkuvõttest otsitulemuste lehel, kirjutage see siia.',
    'Unless the \'Accented URL\' option is enabled (in Shop parameters > Traffic & SEO), only letters, numbers, underscores (_), and hyphens (-) are allowed.' => 'Kui valik „Rõhumärgiga URL” pole lubatud (jaotises Poe Parameetrid> Liiklus & SEO), on lubatud ainult tähed, numbrid, alakriipsud (_) ja sidekriipsud (-).',
    'Search for a product' => 'Otsi toodet',
    'Enter your product name' => 'Sisestage oma toote nimi',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Kokkuvõte on lühike toodet kirjeldav lause.<br />Seda kuvatakse poe tootelehel, toodete nimekirjades ja otsimootorite tulemuste lehel (seega on see oluline SEO jaoks). Kui soovite toodet üksikasjalikumalt kirjeldada, kasutage vahekaarti "Kirjeldus".',
    'Search and add a related product' => 'Otsi ja lisa seotud toode',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Kasutage koma, et märksõnad eraldada. Nt: kleit, puuvill, peokleidid.',
    'Per kilo, per litre' => 'Kilo kohta, liitri kohta',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Kombineerige mitut atribuuti, nt: "Suurus: kõik", "Värv: punane".',
    'Leave empty to disable' => 'Välja lülitamiseks jäta tühjaks',
    'To have a different title from the product name, enter it here.' => 'Kui soovite, et tiitel erineks toote nimest, sisestage see siia.',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Toote lehekülje avalik tiitel, mida näevad otsimootorid. Jätke tühjaks, et kasutada toote nime. Saadaolevate tähemärkide arvu kuvatakse väljast vasakul.',
    'To have a different description than your product summary in search results pages, write it here.' => 'Kui soovite, et kirjeldus erineks toote kokkuvõttest otsitulemuste lehel, kirjutage see siia.',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces)' => 'Seda kirjeldust näidatakse otsingumootorites. Sisesta üks lause, mis on lühem kui 160 märki (koos tühikutega)',
    'To which product the page should redirect?' => 'Millisele tootelehele tuleks suunata?',
    'To which category the page should redirect?' => 'Millisele kategooria lehele tuleks suunata?',
    'If no category is selected the Main Category is used' => 'Kui kategooriat pole valitud, siis kasutatakse peamist kategooriat',
    'Upload a brand logo from your computer.' => 'Laadige üles brändi logo oma arvutist.',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.). A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Kui soovite kiiresti uue kategooria luua, saate seda teha siin. Ärge unustage seejärel minna lehele Kategooriad, et täita vajalikud üksikasjad (kirjeldus, pilt jne). Uut kategooriat ei kuvata teie poe menüüs automaatselt, lugege selle kohta Abist.',
    'This interface allows you to specify the suppliers of the current combination.' => 'See liides võimaldab määrata selle kombinatsiooniga toote tarnijad.',
    'Using another image as cover will automatically uncheck this box.' => 'Teise pildi kasutamine kaanenpildina tühistab selle ruudu automaatselt.',
    'This is the net sales price for your customers. The retail price (tax incl.) will automatically be calculated using the selected tax rate.' => 'See on teie klientide puhas müügihind. Jaehind (koos maksudega) arvutatakse automaatselt valitud maksumäära kasutades.',
    'Indicate the price for a single unit of the product. For instance, if you\'re selling fabrics, it would be the price per meter.' => 'Märkige toote ühe ühiku hind. Näiteks kui müüte kangaid, oleks see meetri hind.',
    'This description will appear in search engines. It should be a single sentence, shorter than 160 characters (including spaces).' => 'Seda kirjeldust näidatakse otsingumootorites. See peaks olema üks lause, mis on lühem kui 160 märki (koos tühikutega).',
    'Public title for the product page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the right of the field.' => 'Avalik pealkiri tootelehel ning otsingumootorites. Jätke tühjaks, et kasutada toote nime. Allesjäänud tähemärkide arv on näidatud välja paremas otsas.',
    'Will appear in the list of suppliers.' => 'Will appear in the list of suppliers.',
    'Upload a supplier logo from your computer.' => 'Upload a supplier logo from your computer.',
    'Only letters and the minus (-) character are allowed.' => 'Ainult tähed ja miinusmärk(-) on lubatud',
    'Search name' => 'Nime otsimine',
    'Search ref.' => 'Otsingu viide',
    'Search category' => 'Otsi kategooriast',
    'Permanently delete this product.' => 'Kustutab selle toote püsivalt.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Vaadake, kuidas teie tooteleht näeb välja veebis: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Lubab või keelab toote poes: ALT+SHIFT+O',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'Salvestab toote ja jääb praegusele lehele: ALT+SHIFT+S',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'Toote salvestamine ja kopeerimien ning uue toote juurde liikumine: ALT+SHIFT+D',
    'Save and go back to the catalog: ALT+SHIFT+Q' => 'Salvestamine ja tagasi kataloogi liikumine: ALT+SHIFT+Q',
    'Save and create a new product: ALT+SHIFT+P' => 'Salvestamine ja uue toote loomine: ALT+SHIFT+P',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Kas toode on pakk (kombinatsioon vähemalt kahest olemasolevast tootest), virtuaalne toode (allalaaditav fail, teenus jms) või lihtsalt tavaline füüsiline toode?',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL. Disabled categories are written in italics.' => 'Kus peaks toode teie saidil saadaval olema? Peamine kategooria on koht, kus toode on vaikimisi. See on kategooria, mida nähakse toote lehekülje URL-is. Välja lülitatud kategooriaid näidatakse kaldkirjas.',
    'Search categories' => 'Otsi kategooriatest',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).  A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Kui soovid lisada kiiresti uut kategooriat, siis saad seda teha siin. Ära unusta minna kategooriate lehele, et täita kogu vajalik info (kirjeldus, pilt jne.). Uut kategooriat ei näidata automaatselt sinu poe menüüs. Palun loe selle kohta lisa abiinfost.',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Kas sellel kombinatsioonil on erinev hind? Kas see on odavam või kallim kui vaikimisi jaehind?',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Kombinatsioonid on toote erinevad variatsioonid, millel on atribuutidel (nt suurus, mass või värv) erinevad väärtused. Kombinatsiooni loomiseks peate looma esmalt toote atribuudid. Selleks avage Kataloog > Atribuudid ja omadused!',
    'To add combinations, you first need to create proper attributes and values in [1]Attributes & Features[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "Generate": it will automatically create all the combinations for you!' => 'Kombintasioonide lisamiseks pead esmalt looma omadused ja väärtused [1]Omadused ja funktsioonid[/1]. <br> Kui see on tehtud, siis saad allolevasse lahtrisse sisestada soovitud omadused (näiteks "suurus" või "värv") ning neile vastavad väärtused ("XS", "punane", "kõik", jne.). Või siis lihtsalt vali need paremal olevast veerust. Seejärel kliki nuppu "Loo". See loob sinu jaoks automaatselt kõik kombinatsioonid!',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "%generate_label%": it will automatically create all the combinations for you!' => 'Kombintasioonide lisamiseks pead esmalt looma omadused ja väärtused [1]%attributes_and_features_label%[/1] sektsioonis. <br> Kui see on tehtud, siis saad allolevasse lahtrisse sisestada soovitud omadused (näiteks "suurus" või "värv") ning neile vastavad väärtused ("XS", "punane", "kõik", jne.) alla kasti või vali need paremalt veerust. Seejärel kliki nuppu "%generate_label%". See loob kõik kombinatsioonid automaatselt!',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'Kui toode on keelatud, valige toote või kategooria nime trükkides leht, millele soovite seda lehte külastavad kliendid suunata.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Suunamist ei toimu (404) = ei suunata kusagile ja kuvatakse 404 "ei leitud" leht.',
    'Permanent redirection (301) = Permanently display another product or category instead.' => 'Püsiv suunamine (301) = kuvab püsivalt muud toodet või kategooriat.',
    'Temporary redirection (302) = Temporarily display another product or category instead.' => 'Ajutine suunamine (302) = kuvab ajutiselt muud toodet või kategooriat.',
    'Display delivery time for a product is advised for merchants selling in Europe to comply with the local laws.' => 'Kohaletoimetamise aja näitamine on Euroopas soovitatav, et see käiks kokku kehtivate seadustega.',
    'edit' => 'muuda',
    'If a carrier has a tax, it will be added to the shipping fees. Does not apply to free shipping.' => 'Kui tarnija küsib tasu, siis see lisatakse transpordi tasudele. Seda ei rakendata tasuta tarne korral.',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'See liides võimaldab määrata toote tarnijad ja selle kombinatsioonid (kui need on olemas).',
    'You can specify supplier references according to previously associated suppliers.' => 'Saate määrata tarnija eriviited vastavalt eelnevalt seotud tarnijatele.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'Kui kasutate täiustatud laojuhtimise tööriista (vt Poe parameetrid > Toote seaded), kasutatakse varude tellimisel teie määratud väärtusi (hind, viited).',
    'You can specify product reference(s) for each associated supplier. Click "Save" after changing selected suppliers to display the associated product references.' => 'Saate määrata toote viite(d) iga seotud tarnija kohta. Klõpsake pärast valitud tarnijate muutmist "Salvesta", et kuvada seotud toote viited.',
    'You can specify product reference(s) for each associated supplier. Click "%save_label%" after changing selected suppliers to display the associated product references.' => 'Saate määrata toote viite(d) iga seotud tarnija kohta. Klõpsake pärast valitud tarnijate muutmist "%save_label%", et kuvada seotud toote viited.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'See liides võimaldab määrata, mis laudes antud toode on ladustatud.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Igale tootele või kombinatsioonile on võimalik määrata ka asukoht laos.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Number of days this file can be accessed by customers. Set to zero for unlimited access.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'Laadige üles fail oma arvutist (max %maxUploadSize%)',
    'The full filename with its extension (e.g. Book.pdf)' => 'Täielik failinimi koos laiendiga (näiteks: Book.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Number of downloads allowed per customer. Set to 0 for unlimited downloads.',
    'If set, the file will not be downloadable after this date. Leave blank if you do not wish to attach an expiration date.' => 'Kui on seatud, siis fail ei ole alla laetav peale seda kuupäeva. Jätke tühjaks, kui ei soovi seda kasutada.',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Minimaalne kogus, mis on nõutud toote ostmiseks (seadke väärtusele 1, et see funktsioon keelata). Nt juhul, kui seada selle väärtuseks 3, saavad kliendid toodet osta ainult juhul, kui nad tellivad vähemalt 3.',
    'The email will be sent to all the users who have the right to run the stock page. To modify the permissions, go to [1]Advanced Parameters > Team[/1]' => 'Kiri saadetakse kõigile kasutajatele kellel on õigus laoseisu hallata. Õiguste muutmiseks ava [1]Lisaparameetri > Meeskond[/1]',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Kombinatsioonid on toote erinevad variatsioonid, mille atribuutidel (nt suurus, mass või värv) on erinevad väärtused. Kas teie toode vajab kombinatsioone?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Täpsemad seaded jaotises [1][2]Kombinatsioonid[/1]',
    'Your reference code for this product. Allowed special characters: .-_#.' => 'Teie toote viitekood. Lubatud sümbolid: .-_#.',
    'How many products should be available for sale?' => 'Kui palju tooteid peaks olema müümiseks saadaval?',
    'Advanced settings in [1][2]Quantities[/1]' => 'Täiendavad seaded jaotises [1][2]Kogused[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'See on jaehind, millega plaanite toodet klientidele müüa. Maksudega hind muutub olenevalt valitud maksureeglist.',
    'Advanced settings in [1][2]Pricing[/1]' => 'Täiendavad seaded jaotises [1][2]Hinnad[/1]',
    'Tags are meant to help your customers find your products via the search bar.' => 'Märksõnad aitavad klientidel leida tooteid otsinguriba kaudu.',
    'Choose terms and keywords that your customers will use to search for this product and make sure you are consistent with the tags you may have already used.' => 'Valige mõisted ja märksõnad, mida kliendid kasutavad toote otsimisel ja veenduge, et hoiate ühtsust juba kasutatud siltidega.',
    'You can manage tag aliases in the [1]Search section[/1]. If you add new tags, you have to rebuild the index.' => 'Siltide aliaseid saad muuta [1]Otsingu sektsioonis[/1]. Kui lisad uusi silte, siis tuleb ka indeks uuesti luua.',
    'Not all shops sell new products. This option enables you to indicate the condition of the product. It can be required on some marketplaces.' => 'Kõik poed ei müü uusi tooteid. See suvand võimaldab näidata toote seisukorda. See võib olla nõutud teatud turgudel.',
    'ISBN is used internationally to identify books and their various editions.' => 'ISBN-i kasutatakse rahvusvaheliselt raamatute ja nende väljaannete eristamiseks.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.',
    'MPN is used internationally to identify the Manufacturer Part Number.' => 'MPN on rahvusvaheliselt kasutatud, et tuvastada Looja Osa Numbrit (Manufacturer Part Number).',
    'This is the price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'See on hind, millega plaanite toodet klientidele müüa. Maksudega hind muutub olenevalt valitud maksureeglist.',
    'Some products can be purchased by unit (per bottle, per pound, etc.),  and this is the price for one unit. For instance, if you’re selling fabrics, it would be the price per meter.' => 'Mõningaid tooteid saab osta ühiku kaupa (pudeli, kilo vms kaupa) ja see on ühe ühiku hind. Nt juhul, kui müüte riiet, saate valida meetrihinna.',
    'The cost price is the price you paid for the product. Do not include the tax. It should be lower than the retail price: the difference between the two will be your margin.' => 'Omahind on hind, mille maksite toote eest. See ei sisalda makse. See peaks olema madalam kui jaehind: nende kahe erinevus on kasumimarginaal.',
    'You can set specific prices for customers belonging to different groups, different countries, etc.' => 'Erinevatesse gruppidesse, riikidesse jne kuuluvatele klientidele saab määrata erihinnad.',
    'Sometimes one customer can fit into multiple price rules. Priorities allow you to define which rules apply first.' => 'Vahel vastab klient mitme hinnareegli nõuetele. Prioriteedid saavad määrata, millised reeglid on tähtsamad.',
    'Invalid token' => 'Vigane märk',
    '[1]Invalid token[/1]: direct access to this link may lead to a potential security breach.' => '[1]Vigane luba[/1]: otsene juurdepääs sellele lingile võib põhjustada potentsiaalse turbemurde.',
