    'You are editing this page for a specific shop or group. Click "%yes_label%" to check all fields, "%no_label%" to uncheck all.' => 'Oled muutmas seda lehte kindlale poele või grupile. Kliki "%yes_label%", et valida kõik väljad või "%no_label%", et valida mitte ühtegi.',
