  'AdminDesignNotification' => 
  array (
    'Your page will be saved as a draft' => 'Teie leht salvestatakse mustandina',
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Võite jätta oma pildid praeguse salvestussüsteemi juurde - selles pole midagi halba.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'Kuid kui olete otsustanud oma pildid liigutada uute salvestussüsteemi, siis vajutage "Liiguta pilte" nupule allpool. Palun olge kannatlikud, kuna see võib võtta aega mitu minutit.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Peale kõikide tootepiltide liigutamist, seadke parimaks jõudluseks "Kasutage vana piltide salvestussüsteemi" Ei peale.',
    'Be careful! Depending on the options selected, former manually uploaded thumbnails might be erased and replaced by automatically generated thumbnails.' => 'Olge ettevaatlik! Vastavalt valitud seadetele võivad varasemalt üleslaetud pisipildid kustuda ning asenduda automaatselt genereeritutega.',
    'Also, regenerating thumbnails for all existing images can take several minutes, please be patient.' => 'Lisaks võib kõikide pisipiltide taasgenereerimine võtta mitu minutit, palun olge kannatlik.',
    'If you want to order/move the following data, please select a shop from the shop list.' => 'Kui soovite tellida/liigutada järgnevaid andmeid, siis palun valige esmalt pood poodide nimekirjast.',
    'Current theme is unavailable. Please check your theme\'s directory name ("%s") and permissions.' => 'Valitud teema pole saadaval. Palun kontrolli teema kataloogi nime ("%s") ja õiguseid.',
