    'Duplicate images were found when moving the product images. This is likely caused by unused demonstration images. Please make sure that the folder %folder% only contains demonstration images, and then delete it.' => 'Toote piltide liigutamisel leiti topelt tootepilte. Selle põhjuseks on ilmselt kasutamata näidispildid. Palun veendu, et kaustas %folder% oleksid ainult näidispildid ja kustuta need ära.',
    'Incorrect value for the selected JPEG image compression.' => 'Vigane väärtus valitud JPEG pildi pakkimiseks.',
    'Incorrect value for the selected PNG image compression.' => 'Vigane väärtus valitud PNG pildi pakkimiseks.',
    'Source file does not exist or is empty (%filepath%)' => 'Lähtefaili ei eksisteeri või see on tühi (%filepath%)',
    'Failed to resize image file (%filepath%)' => 'Pildifaili (%filepath%) suuruse muutmine ebaõnnestus',
    'Failed to resize image file to high resolution (%filepath%)' => 'Pilti ei õnnestunud suuremaks muuta (%filepath%)',
    'Original image is corrupt (%filename%) for product ID %id% or bad permission on folder.' => 'Toote ID %id% originaalpilt on vigane (%filename%) või kausta õigused valesti määratud.',
    'Original image is missing or empty (%filename%) for product ID %id%' => 'Toote ID %id% originaalpilt puudub või on tühi (%filename%)',
    'Cannot write images for this type: %1$s. Please check the %2$s folder\'s writing permissions.' => 'Ei saa kirjutada pilte antud tüübiga: %1$s. Palun kontrollige %2$s kataloogi kirjutusõiguseid.',
    'Only part of the images have been regenerated. The server timed out before finishing.' => 'Ainult osa piltidest genereeriti uuesti. Serveri päringu aeg lõppes enne.',
    'Server timed out. The watermark may not have been applied to all images.' => 'Server lõpetas päringu, vesimärk ei pruugi olla kõigile piltidele lisatud',
    'Cannot write "No picture" image to %s images folder. Please check the folder\'s writing permissions.' => 'Ei saa salvestada "Pilt puudub" pilti nõutud kataloogi (%s). Palun kontrollige antud kataloogi kirjutusõiguseid.',
    'Error: Your server configuration is not compatible with the new image system. No images were moved.' => 'Viga: Teie serveri seadistus ei ole ühilduv uue piltide süsteemiga. Ühtegi pilti ei liigutatud.',
    'Not all images have been moved. The server timed out before finishing. Click on "Move images" again to resume the moving process.' => 'Kõiki pilte ei õnnestunud liigutada. Serveri lõpetas enne päringu. Vajutage uuesti "Liigutage pilte" nuppu, et jätkata tööd.',
    'Error: Some -- or all -- images cannot be moved.' => 'Viga: mõnda või kõiki pilte ei saa liigutada.',
    'After modification, do not forget to regenerate thumbnails' => 'Peale muudatuste sisse viimist ärge unustage pisipilte uuesti genereerida',
    'Not all images have been moved. The server timed out before finishing. Click on "%move_images_label%" again to resume the moving process.' => 'Kõiki pilte ei õnnestunud liigutada. Serveri lõpetas päringu enne lõpetamist. Vajutage uuesti "%move_images_label%" nuppu, et jätkata piltide liigutamist.',
    'The uploaded file is too large.' => 'Üles laaditud fail on liiga suur.',
    'Failed to move uploaded file.' => 'Üles laaditud faili liigutamine ebaõnnestus.',
    'This theme is not valid for PrestaShop 1.7' => 'Teemat ei saa PrestaShop 1.7 puhul kasutada',
    'An error occurred. The information "%s" is missing.' => 'Ilmnes viga. Info "%s" puudub.',
    'An error occurred. The template "%s" is missing.' => 'Ilmnes viga. Mall "%s" puudub.',
    'An error occurred while uploading the favicon: cannot copy file "%s" to folder "%s".' => 'Tekkis tõrge faviconi ülesse laadimisel: ei saa kopeerida faili "%s" kataloogi "%s".',
    'Your theme has been correctly exported: %path%' => 'Teie teema eksportimine õnnestus: %path%',
    'The page Category cannot be moved here.' => 'Lehekülje kategooriat ei saa siia liigutada.',
    'Your RTL stylesheets has been generated successfully' => 'Sinu paremalt vasakule (RTL) stiiliehed on loodud',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'Regenerate thumbnails\' button.' => 'Sinu teema vaikeseaded on taastatud. Ilmselt soovid pildid uuesti luua. Otsi leheküljelt Täienda > Kujundus > Piltide seaded üles nupp \'Genereeri uuesti pisipildid\'.',
    'There is already a theme %theme_name% in your themes folder. Remove it if you want to continue.' => 'Teema nimega %theme_name% on sinu teemade kaustas juba olemas. Kui soovid jätkata, siis palun eemalda see teema.',
    'Failed to delete theme. Make sure you have permissions and theme is not used.' => 'Teema kustutamine ebaõnnestus. Veendu, et sul on vajalikud õigused olemas ning et teema poleks kasutuses.',
    'Cannot adapt theme to RTL languages.' => 'Teema kohandamine paremalt-vasakule keeltele ebaõnnestus.',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'%regenerate_label%\' button.' => 'Sinu teema vaikeseaded on taastatud. Peaksite pildid uuesti looma. Kasutage leheküljel Täienda > Kujundus > Piltide seaded lehel nuppu \'%regenerate_label%\'.',
    'This name already exists.' => 'Antud nimi on juba kasutusel',
