  'AdminShopparametersHelp' => 
  array (
    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Otsekülastuste maht võib olla üsna mahukas. Peaksite selle sisse lülitama ainult siis, kui Teil on tugev andmebaasi server ja tungiv vajadus selle järgi.',
    'Show me more' => 'Näita rohkem',
    'Definitions:' => 'Definitsioonid:',
    'The "http_referer" field is the website from which your customers arrive.' => 'The "http_referer" field is the website from which your customers arrive.',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Nii et kui soovite, et kõik külastajad tulevad google, võite tippida \\"% google%\\". Kui soovite hankida infot Google Prantsusmaa kaudu tulevate klientide andmeid, siis sisestage \\"% google.fr%\\".',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'The "request_uri" field is the URL from which the customers come to your website.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'See on kasulik, sest saate lisada mõningaid märke ja silte linkidele, mis Teie poodi toovad.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.',
    'The "Include" fields indicate what has to be included in the URL.' => 'The "Include" fields indicate what has to be included in the URL.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'The "Exclude" fields indicate what has to be excluded from the URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Lihtsa režiimi kasutamisel saate asendada muid tähemärke suure valiku üldiste sümbolitega:',
    '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".',
    '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.',
    'Take a look at MySQL\'s documentation for more details.' => 'Take a look at MySQL\'s documentation for more details.',
    'Get help!' => 'Abi!',
    'e.g. 10:00AM - 9:30PM' => 'Näiteks: 10:00-21:30',
    'Further information regarding this contact.' => 'Edaspidine informatsioon antud kontakti kohta.',
    'Image width in pixels. Enter "0" to use the original size.' => 'Pildi laius pikslites. Sisestage 0, et kasutada originaal suurust',
    'Image height in pixels. Enter "0" to use the original size.' => 'Pildi kõrgus pikslites. Sisestage 0, et kasutada originaal suurust',
    'The group defined for your un-identified visitors.' => 'The group defined for your un-identified visitors.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'The group defined for your identified guest customers (used in guest checkout).',
    'The group defined for your identified registered customers.' => 'The group defined for your identified registered customers.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Võimaldab automaatselt kõigile poe toodetele antud allahindluse selle grupi liikmetele.',
    'How prices are displayed in the order summary for this customer group.' => 'Kuidas näidatakse selle kliendigrupi tellimuste kokkuvõtet (maksudega või ilma)?',
    'Customers in this group can view prices.' => 'Customers in this group can view prices.',
    '%group_name% - All persons without a customer account or customers that are not logged in.' => '%group_name% - kõik kasutajad, kellel pole kliendi kontot või pole sisse loginud.',
    '%group_name% - All persons who placed an order through Guest Checkout.' => '%group_name% - kõik kasutajad, kes on esitanud tellimuse külalisena.',
    '%group_name% - All persons who created an account on this site.' => '%group_name% - kõik kliendid, kes on loonud konto antud poes.',
    'PrestaShop has three default customer groups:' => 'PrestaShopil on vaikimisi kolm kliendigruppi:',
    'Need to hide prices for all groups? Save time, enable catalog mode in Product Settings instead.' => 'Soovid kõik hinnad peita kõikide gruppide eest? Säästa aega ning lülita hoopis seadetest sisse kataloogirežiim.',
    'Leave blank if no change.' => 'Leave blank if no change.',
    'Fee given for each visit.' => 'Tasu iga külastuse kohta',
    'Fee given for each order placed.' => 'Tasu iga ostu eest.',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Kui oskate kasutada MySQL-i regulaaravaldisi, saate kasutada [1]eksperdirežiimi[/1].',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'Vaikimisi - otsides "blouse" peate sisestama "blous", "blo" või muu kombinatsiooni (sõna algusest) - kuid mitte "lous" - (sõna keskelt).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Selle võimalusega saad tulemuse ka siis kui sisestad \\"lous\\", \\"ouse\\" või mingi muu kombinatsiooni sõna seest.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Pigem luba otsing sõna seest kui ainult algusest.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'See kontrollib kas otsitud termin on indekseeritud sõnade hulgas. See võib olla ressursinõudlik.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Vaikimisi, kui otsite "book", siis kuvatakse Teile "book", "bookcase" ja "bookend".',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Selle võimalusega saad tulemuseks ainult \\"book\\"',
    'Enable more precise search with the end of the word.' => 'Luba palju täpsem otsing mis lõppeb otsitava terminiga',
    'It checks if the searched term is the exact end of the indexed word.' => 'See kontrollib kas otsitav termin sobib täpselt indekseeritud sõnaga',
    'Only words this size or larger will be indexed.' => 'Sellest pikemad sõnad indekseeritakse.',
    'Please enter the index words separated by a "|".' => 'Sisesta sõnad, mis on eraldatud püstkriipsuga ("|"-märgiga)',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Keelatud tähemärgid: <>;=#{}',
    'Search this word instead.' => 'Otsi seda sõna hoopis.',
    'By default, the fuzzy search is enabled. It means spelling errors are allowed, e.g. you can search for "bird" with words like "burd", "bard" or "beerd".' => 'Tavaliselt on umbmäärane otsing sisse lülitatud. See tähendab, et kirjutusvead on lubatud, ehk saad otsida "lind" kasutades sõnu nagu "lend", "land".',
    'Enable approximate string matching.' => 'Lubage umbkaudsete sõnade kokkusobitamine.',
    'Note that this option is resource-consuming: the more you search, the longer it takes.' => 'Pange tähele, et see seade on rohkesti jõudlust kasutav: mida rohkem otsitakse, seda kauem see võtab.',
    'Disabling this option will require exact spelling for the search to match results.' => 'Selle seade väljalülitamisel vajab otsing eseme näitamiseks täpset kirjutamist.',
    'Only words fewer or equal to this maximum length will be searched.' => 'Otsitakse ainult sõnu mis on lühemad või sama pikad.',
    'This parameter will only be used if the fuzzy search is activated: the lower the value, the more tolerant your search will be.' => 'Seda paremeetrit kasutatakse ainult kui umbmäärane otsing on sisse lülitatud: mida väiksem väärtus, seda tolereerivam on otsing.',
    'This field does not refer to the shop name visible in the front office.' => 'See väli ei viita nimele mis on veebipoes nähtav.',
    'Follow [1]this link[/1] to edit the shop name used on the front office.' => 'Kasuta [1]this link[/1], et muuta poe nime mida veebipood kasutab.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Te ei saa poodide gruppi muuta, kuna praegune pood kuulub gruppi, kus on aktiveeritud andmete jagamise valikud.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, [1]please click here[/1].' => 'See on peakategooria Teie loodavele pole. Uue peakategooria määramiseks [1]kliki palun siia[/1].',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Valides seotud kategooriaid, valite erinevate kategooriate jagamise poodide vahel. Korra poega liidetud kategooriate puhul, iga muudatus, mis kategoorias tehakse, mõjutab igat poodi, mis selle kategooriaga seotud on.',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Lae üles ikoon oma arvutist (failitüüp: .gif, soovitatav suurus 16x16 px).',
