    'Allow IP addresses to access the store, even in maintenance mode. Use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96).' => 'Luba IP aadressitel poele ligi pääseda, isegi hoolduse režiimis. Kasutage tavalist koma nende eraldamiseks (nt. 42.24.4.2,127.0.0.1,99.98.97.96).',
