    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Saad valida kuskohas ümardada : kas igal toote puhul, iga rea puhul või arve lõppsumma puhul.',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Luba poes enimmüüdute näitamine, isegi kui vastav moodul on keelatud.',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => 'Mitmikpoe valik võimaldab Teil hallata mitut erinevat poodi ühest administraatori liidesest. Kui see on aktiveeritud, siis on nähtav Mitmikpoe menüü.',
    'Enable suppliers page on your front office even when its module is disabled.' => 'Lubage varustajate lehekülje näitamine, isegi kui vastav moodul on keelatud.',
    'Enable brands page on your front office even when its module is disabled.' => 'Lubage brändide lehekülje näitamine, isegi kui vastav moodul on keelatud.',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Kuvab ülevaate aadressidest, tarneviisist ja ostukorvi sisust enne tellimise kinnitamist (nõutud teatud Euroopa riikides).',
    'Allow guest visitors to place an order without registering.' => 'Luba külalistel oste vormistada ilma registreerimata.',
