    'Catalog mode disables the shopping cart on your store. Visitors will be able to browse your products catalog, but not buy them.' => 'Kataloogirežiim lülitab sinu poes välja ostukorvi funktsiooni. Külastajad saavad tooteid vaadata, aga mitte neid osta.',
    'Have specific needs? Edit particular groups to let them see prices or not.' => 'Sul on mingid erivajadused? Muuda konkreetset gruppi, et neile hind nõidata või siis mitte näidata.',
