    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Koguselise allahindluse tabelis, näidake uut hinda, millest on soodustus juba maha võetud. Vaikimisi näidatakse lihtsalt soodustust (nt. -5%).',
    'Display the "%add_to_cart_label%" button when a product has attributes' => 'Näita "%add_to_cart_label%" nuppu, kui tootel on kohandusvõimalused',
