    'Default order method for product list.' => 'Default order method for product list.',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Vaikimisi on Lisa ostukorvi nupp peidetud, kui toode pole saadaval. Võite määrata, et näitate seda igal juhul.',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Soovitatud Euroopa poodidele, et toimida kooskõlas seadusega (nt: kohaletoimetamine 3-4 päevaga)',
